class Resume extends Component {




    render() {
        return(
            <div>
                <h2>Resume</h2>
                <h3>Education</h3>
                <h4>University of London - Bachelors of Science Computer Science</h4>
                <p>October 2019 - 2023</p>
            </div>
        )
    }

}

export default Resume;
